import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href="/">Eunoia</a>
      </header>
      <main> 
        <h1>Featured Products</h1>
        {data.products.map(product => (<div>
          <img src={product.image} alt={product.name} />
          <></>
        </div>) )}
      </main>
    </div>
  );
}

export default App;
